import React from 'react';

import Calendar from '../components/Calendar'
import IntakeList from '../components/IntakeList'

import './ControlCentre.css'


const ControlCentre = () => {
    const calendarExists = true
    const program = false
    const INTAKES = [{id:'1', number:'1', date:'1/05/2020', hour:'15:30', med:'Omeoprazol'}, {id:'2', number:'2', date:'1/05/2020', hour:'9:30', med:'Aspirina'}]
    return (
     <div>
       {/*  <Calendar calendarExists={calendarExists}></Calendar> */}
        <IntakeList program={program} intakes={INTAKES}></IntakeList>
     </div>
    )
}

export default ControlCentre
